import React from 'react';
import './ExploreContainer.css';
import { userInfo } from 'os';
import { IonInput, IonTitle } from '@ionic/react';

interface ContainerProps { }

//https://dev.to/camilomejia/fetch-data-with-react-hooks-and-typescript-390c

export interface User {
  name: string,
  eMail: string,
  password: string
}

class ExploreContainer extends React.Component {

  state = {
    users: [],
    url: 'https://192.168.1.67:5001/api/user'
  }

  componentDidMount() {

    let data: User[];

    fetch(this.state.url, {
      method: "GET"
    })
    .then(res => res.json())
    .then((res: User[]) => data = res)
    .then(res => this.setState({
      users: res 
    }));       
  }

  render() {
    return (
        <>
        <IonTitle>Informação carregada de {this.state.url}</IonTitle>
        <div>
          <ul>
            {this.state.users.map((user: User) => {
              return <li key={user.eMail}>
            {
            <>
              <strong>{"Utilizador : " + user.name}</strong>
              <p>{"E-MAIL     : " + user.eMail}</p>
              <p>{"Password   : " + user.password}</p>
            </>
            }</li>
          })}
        </ul>
      </div>
      <div>
        <IonTitle>Enviar uma :</IonTitle>
        <IonInput placeholder="Insira a api"></IonInput>
      </div>
      </>
    );
  }


};

export default ExploreContainer;
